import React from 'react'
import Explorer from './Explorer'
import { BrowserRouter, Route, Link } from 'react'; 
import {Router} from 'react-router-dom';
import {addFile} from './addFile';
function App() {
  return <main>
    <h1>Explorer</h1>
    <h2>./files/</h2>
      <Router>

      <Route path="/" component={Explorer} />
      </Router>
  </main>
}

export default App
